void sconst(char* s){

    if( strcmp(s,"\\n") == 0){
  
	strtemp[i] = '\n'; 
    
    }
    
    else if( strcmp(s,"\\v") == 0){
      
	strtemp[i] = '\v'; 
    
    }

    else if( strcmp(s,"\\r") == 0){
    
	strtemp[i] = '\r'; 
    }

    else if( strcmp(s,"\\f") == 0){
    
	strtemp[i] = '\f'; 
    
    }

    else if( strcmp(s,"\\t") == 0){
    
	strtemp[i] = '\t';
    
    }

    else if( strcmp(s,"\\b") == 0){
    
	strtemp[i] = '\b'; 
    
    }

    else if( strcmp(s,"\\") == 0){
    
	strtemp[i] = '\\';
    
    }

    else if( strcmp(s,"\\\n") == 0){
    
	i--;
    
    }

    else{
    
	strtemp[i] = s[0];
    
    }
    
    i++;

}

void strprint(void){

  for(j=0;j<=i;j++){
  
      printf("%c",strtemp[j]);
  
  }

  printf("\n");
  
}

long double stold(char *s, int base){

  int k;
  int int_temp = 0;
  int powe = 0;
  int dot = 0;
  char char_temp;
  double double_temp=0;
  double told_num_base = 0;
  
  for(k=2; k<yyleng; k++){
  
    if(s[k] != '.'){
    
	dot++;
    
    }
  
    else { break; }
  
  }

  for(k=1+dot; k>1; k--){
  
    char_temp = s[k];
    int_temp = atoi(&char_temp);
    double_temp = powl((double)base,(double)powe);
    told_num_base = told_num_base + (int_temp * double_temp);
    powe++;
  
  }
  
  powe = -1;
  
  for(k=3-dot; k<yyleng; k++){
  
    char_temp = s[k];
    int_temp = atoi(&char_temp);
    double_temp = powl((double)base,(double)powe);
    told_num_base = told_num_base + (int_temp * double_temp);
    powe--;
  
  }
  
  return (told_num_base);
  
}



